import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { DocumentTextIcon, ExclamationCircleIcon } from '@heroicons/react/24/outline';
import { useAuth } from '../contexts/AuthContext';

const ResultsPage = () => {
  const [results, setResults] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const { user } = useAuth();

  useEffect(() => {
    const fetchResults = async () => {
      try {
        setIsLoading(true);
        // Use the user-specific endpoint for doctors and the global endpoint for admins
        const endpoint = user.role === 'admin' ? '/api/results' : '/api/results/user';
        const response = await axios.get(endpoint);
        
        // Sort by timestamp, newest first
        const sortedResults = response.data.sort((a, b) => 
          new Date(b.timestamp) - new Date(a.timestamp)
        );
        setResults(sortedResults);
        setIsLoading(false);
      } catch (error) {
        console.error('Error fetching results:', error);
        setError('Failed to load results. Please try again later.');
        setIsLoading(false);
      }
    };

    fetchResults();
  }, [user.role]);

  if (isLoading) {
    return (
      <div className="text-center py-12">
        <div className="inline-block h-8 w-8 animate-spin rounded-full border-4 border-solid border-indigo-600 border-r-transparent"></div>
        <p className="mt-4 text-gray-600">Loading results...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="bg-red-50 p-4 rounded-md">
        <div className="flex">
          <ExclamationCircleIcon className="h-5 w-5 text-red-400" aria-hidden="true" />
          <div className="ml-3">
            <h3 className="text-sm font-medium text-red-800">{error}</h3>
          </div>
        </div>
      </div>
    );
  }

  if (results.length === 0) {
    return (
      <div className="space-y-6">
        <div className="flex justify-between items-center">
          <h1 className="text-2xl font-semibold text-gray-900">
            {user.role === 'admin' ? 'All Results' : 'My Results'}
          </h1>
          <Link to="/upload" className="btn-primary">
            Upload New Scan
          </Link>
        </div>
        
        <div className="bg-white shadow rounded-lg p-12 text-center">
          <DocumentTextIcon className="mx-auto h-12 w-12 text-gray-400" />
          <h3 className="mt-2 text-lg font-medium text-gray-900">No results found</h3>
          <p className="mt-1 text-gray-500">Upload a CT scan to get started.</p>
          <div className="mt-6">
            <Link 
              to="/upload"
              className="inline-flex items-center px-4 py-2 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
            >
              Upload CT Scan
            </Link>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center">
        <div>
          <h1 className="text-2xl font-semibold text-gray-900">
            {user.role === 'admin' ? 'All Results' : 'My Results'}
          </h1>
          <p className="text-sm text-gray-500 mt-1">
            {user.role === 'admin' 
              ? 'As an administrator, you can view all CT scan results from all users.' 
              : 'You can view the CT scan results you have uploaded.'}
          </p>
        </div>
        <Link to="/upload" className="btn-primary">
          Upload New Scan
        </Link>
      </div>

      <div className="bg-white shadow rounded-lg overflow-hidden">
        <div className="px-4 py-5 border-b border-gray-200 sm:px-6">
          <h3 className="text-lg font-medium text-gray-900">
            CT Scan Results ({results.length})
          </h3>
        </div>
        <ul className="divide-y divide-gray-200">
          {results.map((result) => (
            <li key={result.case_name}>
              <Link 
                to={`/results/${result.case_name}`} 
                className="block hover:bg-gray-50"
              >
                <div className="px-4 py-4 sm:px-6">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center">
                      <div className="flex-shrink-0">
                        <DocumentTextIcon className="h-6 w-6 text-gray-400" aria-hidden="true" />
                      </div>
                      <div className="ml-3">
                        <div className="flex items-center">
                          <p className="text-sm font-medium text-indigo-600 truncate">{result.case_name}</p>
                          {user.role === 'admin' && (
                            <span className={`ml-2 px-2 py-0.5 inline-flex text-xs leading-5 font-semibold rounded-full ${
                              result.user === user.username 
                                ? 'bg-blue-100 text-blue-800' 
                                : 'bg-purple-100 text-purple-800'
                            }`}>
                              {result.user === user.username ? 'Your Scan' : `Dr. ${result.user}`}
                            </span>
                          )}
                        </div>
                        <div className="flex text-sm text-gray-500">
                          <p>Processed on {new Date(result.timestamp).toLocaleString()}</p>
                          {user.role === 'admin' && result.user && result.user !== user.username && (
                            <p className="ml-2 pl-2 border-l border-gray-300">
                              Uploaded by: <span className="font-semibold">{result.user}</span>
                            </p>
                          )}
                        </div>
                      </div>
                    </div>
                    <div className="ml-2 flex-shrink-0 flex">
                      <p className="px-2 inline-flex text-xs leading-5 font-semibold rounded-full bg-green-100 text-green-800">
                        View Details
                      </p>
                    </div>
                  </div>
                </div>
              </Link>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default ResultsPage;
